import './App.css';
import { BrowserRouter as Router, Routes, Route, BrowserRouter } from 'react-router-dom';
import Login from './login/login';
import Sidi from './sidi';
import Jwadou from './jwadou';
import Uploadcour from './nav/sidi/Uploadcour';
import ProfilePage from './nav/ProfilePage';
import Agenda from './nav/jwadou/agenda/agenda-jwadou';

import Body2 from './nav/jwadou/body2';
import Body from './nav/jwadou/body';
import Task from './nav/jwadou/task';

import UploadTask from './nav/jwadou/carte/UploadTask ';


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Login />} />
          <Route path='/jwadou' element={<Jwadou />} />
          <Route path='/sidi' element={<Sidi />} />
          <Route path='/Uploadcour' element={<Uploadcour/>} />
                  <Route path='/agenda-sidi' element={<Agenda/>} />
                 <Route path='/profilj' element={<ProfilePage />} />
                 <Route path='/Body23' element={<Body />} />
                 <Route path='/cour' element={<Body2 />} />
                 <Route path='/task' element={<Task />} />
                 <Route path='/profil' element={<ProfilePage />} />
                 <Route path='/agenda-jwadou' element={<Agenda />} />
                 <Route path='/task1' element={<UploadTask />} />
          {/* Other routes here */}
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
